import React, { Component } from 'react';

class Content extends Component {
    render() {
        return (
            <React.Fragment>
                <div className='container-fluid m-2 p-2'>
                    <h1 className='display-2 greeting'>Hello,</h1>
                    <h1 className='display-4 port_name'>I am Arghya Sahoo</h1>

                </div>
            </React.Fragment>
        );
    }
}

export default Content;
